// SPDX-License-Identifier: MIT
pragma solidity 0.8.8;

import './structs/Official.sol';
// user can register base on state and  country
// create Applicant  only owner
//  set vote day
//  set accredicted vote location
//  user can watch vote as e edy go
// https://medium.com/blockcentric/ethereum-dapp-portfolio-ideas-21e1aac6dc52
//https://www.ethhole.com/challenge

contract EVote{

    address private ownerAddr;
    address[] accredictedOfficialAddr;
    mapping(address=>Official) accredictedOfficialDetails; 
    mapping(string=>VoteZone) accredictedZone;

    modifier isOwnerMod{
        require(ownerAddr != msg.sender,"you can not add official");
        _;
    }

    constructor (){
        ownerAddr = msg.sender;
    }

    function addZone(string calldata lga, string calldata code, string calldata state)  external isOwnerMod{
        //require(accredictedZone[code] , "local government already exist");
        accredictedZone[code] = VoteZone(lga,state,code);
    }

    function accredictedNewOfficial(address officialAddress, string calldata zoneCode) external isOwnerMod{
        require(bytes(accredictedZone[zoneCode].lga).length < 0 ,"local not found");
        accredictedOfficialAddr.push(officialAddress);

        //accredictedOfficialDetails[zoneCode];
        //check for the code that match the selec
    }

}

